import React from 'react';
import s from './Navbar.module.css';

const Navbar = () => {
    return (
        <nav className={s.nav}>
            <div className={s.navItem}><a href='/profile'>Profile</a></div>
            <div className={s.navItem}><a href='/dialogs'>Messages</a></div>
            <div className={s.navItem}><a href='/news'>News</a></div>
            <div className={s.navItem}><a href='/music'>Music</a></div>
            <div className={s.navItem}><a href='settings'>Settings</a></div>
        </nav>
    );
};

export default Navbar;
